import React from 'react';

export const PageRight = (props) => {
  return (
    <div style={styles.backgroundStyle}>
      {props.children}
    </div>
  );
};

const styles = {
  backgroundStyle: {
    background: 'purple',
    display: 'flex',
    position: 'absolute',
    top: 0,
    right: 0,
    height: '100%',
    flexDirection: 'column',
    flexGrow: 1,
  },
};
